$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Ao criar um novo formulário de contato, se você clicar no link [1]\"Adicionar novo campo/linha de entrada para criar seu formulário de contato\"[/1] e selecionar um campo de entrada, por padrão, esse campo de entrada será colocado em um campo completo linha de largura (1 coluna)';
$_MODULE['<{ets_cfultimate}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Para adicionar o campo de entrada reCAPTCHA, você precisa ativar o reCAPTCHA primeiro. Navegue até [1]\"Configurações > Integração > reCAPTCHA\"[/1], ative a opção reCAPTCHA e insira seu par de chaves.';
$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Para saber como obter a chave do site reCAPTCHA e a chave secreta, leia a documentação do nosso módulo';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Para responder às mensagens dos clientes diretamente no back office, você precisa do endereço de e-mail do cliente. Ao criar um formulário de contato, certifique-se de adicionar um campo de entrada de e-mail e marcá-lo como campo obrigatório.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Configurações de e-mail';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Para obter as informações do seu formulário de contato para o e-mail enviado ao administrador ou ao e-mail de resposta automática, copie e cole as respectivas tags de e-mail no campo [1]\"Corpo da mensagem\"[/1] em [1]\"Formulários de contato > Email\"[/1] subguia';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Para receber o arquivo de anexo de seu cliente por e-mail, navegue até [1]\"Formulários de contato > Correio\"[/1] e marque a caixa [1]\"Anexo de arquivo\"[/1].';
$_MODULE['<{ets_cfultimate}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Para receber o arquivo de anexo de seu cliente por meio da guia “Mensagens”, navegue até [1]\"Formulários de contato > Configurações\"[/1] e ative a opção [1]\"Salvar anexos\"[/1].';
